function isPalindrome(string){
  let lowStr = string.toLowerCase();
  let lowStrReg = lowStr.match(/\w+/g).join('');
  
  if (lowStr.split(',').reverse().join('') === lowStrReg){
    return true;
  } else {
    return false
  } 
}

